import React from 'react';
import './Dividers.css';

const Dividers = (props) => {
  return (
    <div className="dividers">
      <div className="divider">A</div>
      <div className="divider">B</div>
      <div className="divider">C</div>
      <div className="divider">D</div>
      <div className="divider">E</div>
      <div className="divider">F</div>
      <div className="divider">G</div>
      <div className="divider">H</div>
    </div>
  );
}

export default Dividers;
